                        <Button
                            className="align-button"
                            onClick={async (e) => {
                            }}
                            style={{ width: "100%" }}
                            variant="outline-primary"
                            size="lg"
                        >
                            No
                        </Button>{" "}
                    </Col>
                </Row>
             </Container>
        </div>
    )
}
